import React from "react";
import logo from "../images/logo.svg";

const Header = () => {
  return (
    <>
      <header className="App-header">
        <img
          src={logo}
          alt="Official logo of Pokemon"
          className="header-logo"
        />
      </header>
    </>
  );
};

export default Header;
